import React from "react";
import { ProgressBar } from "react-bootstrap";
import Content from "../components/Content";
import Header from "../components/Header";

export default function Connect() {
    return (
        <>
            <Header title={"Skills"} caption={"These are some of the skills that I've picked up over the years.  Each skill is rated 0-100 with 0 meaning I'm a beginner and 100 meaning advanced profieciency."} />
            <Content>
                <ProgressBar animated now={40}/>
                <ProgressBar animated now={40}/>
                <ProgressBar animated now={40}/>
                <ProgressBar animated now={40}/>
                <ProgressBar animated now={40}/>
                <ProgressBar animated now={40}/>
                    <div class="progress-bar progress-bar-striped progress-bar-animated" role="progressbar" aria-valuenow="75" aria-valuemin="0" aria-valuemax="100" style="width: 75%"></div>
            </Content>
        </>
    )
}
